import React, {Component} from 'react';
import Banner from '../components/Banner.js'
import PopularCity from '../components/PopularCity.js'

class Home extends Component {
    constructor(props){
        super(props);
        this.state = {
            cityList: [{name: "NewYork", src: "https://photos.mandarinoriental.com/is/image/MandarinOriental/new-york-2017-columbus-circle-01?$MO_masthead-property-mobile$"},
                {name: "Berlin", src: ""},
                {name:"Saigon"},
                {name: "Munich"},
                {name: "Tokyo"},
                {name: "London"},
                {name: "Paris"},
                {name: "Vienn"},
                {name: "Barcelona"},
                {name: "Toronto"}],
            minNum: 0,
        }
    }
    generateRandomNumber = () =>{
        setInterval(() => this.setState({ minNum: Math.random()*6}), 5000);
    };
    display = () =>{
        let cities =[];
        this.state.cityList.map(city=>cities.push(<PopularCity key={city} cityName={city}></PopularCity>));
        this.generateRandomNumber();
        return cities.slice(this.state.minNum,this.state.minNum + 4);
    };
    render() {
        return (
            <div>
                <Banner></Banner>
                <div className="contain">
                    <p className="section">Find your perfect trip, designed by insiders who know and love their
                        cities.</p>
                    <div className="section">
                        <img className="circle" src={require("../images/circled-right.png")} alt="circle"/>
                    </div>
                    <div className="section popularCities">
                        <h5>Popular MYtinerary</h5>
                        <div className="cityDisplay">
                            {this.display()}
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
